"use strict";

$(document).ready(function () {
  $(window).resize(function () {
    stickyCTA();

    if ($(".search-filter-top").length > 0) {
      calcSerchFilterHeight();
    }
  }); //bootstrap modals

  $(document).on("hidden.bs.modal", function () {
    if ($(".modal.show").length) {
      $("body").addClass("modal-open");
    }
  });
  $('.js-navigation-menu').click(function () {
    $(this).parents('.navigation').toggleClass('navigation--open');
    $('.menu__submenu').slideUp();
  });
  $('.js-submenu-toggle').click(function () {
    $(this).parents('.menu__item').toggleClass('active');
    $(this).parents('.menu__item').find('.menu__submenu').slideToggle();
  }); //auto complete

  if ($(".js-autocomplete").length > 0) {
    var options = {
      data: ["blue", "green", "pink", "red", "yellow"]
    };
    $(".js-autocomplete").easyAutocomplete(options);
  }

  function stickyCTA() {
    if ($(window).width() >= 768) {
      if ($(".property-detail-wrapper").length > 0) {
        if ($(window).scrollTop() >= $(".property-detail-wrapper").offset().top + $(".property-detail-wrapper").outerHeight() - window.innerHeight) {
          $(".fixed-cta").addClass("position-static");
        } else {
          $(".fixed-cta").removeClass("position-static");
        }
      }
    }
  }

  $(window).on("scroll", function () {
    stickyCTA();
  }); //show hdie link

  var showhide = false;
  $(".js-showhide-link").on("click", function () {
    var target = $(this).attr("data-target");
    console.log(target);
    $(this).toggleClass("showhide-link--has-shown");

    if (showhide === false) {
      $("#" + target).removeClass("collapse");
      $("#" + target).slideDown();
      showhide = true;
    } else {
      $("#" + target).addClass("collapse");
      $("#" + target).slideUp();
      showhide = false;
    }
  });
});
